import React, { Fragment } from 'react';
import { useNavigate } from "react-router-dom";
import { Button } from 'react-bootstrap';



function HomePage() {
    const navigate = useNavigate();
    const handleClick = e => {
        // e.preventDefault()
        navigate("/" + e);
    }

    return (
        <Fragment>
            <Button role="button" onClick={() => handleClick('SignIn')}>
                sign In
            </Button>
            <Button role="button" onClick={() => handleClick('SignUp')}>
                sign Up
            </Button>
            <Button role="button" onClick={() => handleClick('About')}>
                About
            </Button>
            <Button role="button" onClick={() => handleClick('OrderDrive')}>
                Order Drive
            </Button>
            <Button role="button" onClick={() => handleClick('LogOut')}>
                Log Out
            </Button>
        </Fragment>
    );
};
render(<HomePage />, ROOT_NODE)
export default HomePage;
